import React from 'react';
import logo  from "../logo.png";
import '../style/navbar.css';

export default function Navbar() {
  return (
    // Navbar component with logo and navigation links.
    
    <nav>
        <ul>
          <li><img src={logo} /></li>
          <li>
            <span></span>
          </li>
        </ul>
        <ul>
          <li>Home</li>
          <li>About</li>
          <li>Contact</li>
        </ul>
      <ul className="social-media"></ul>
    </nav>
  );
}
